    border-color:#bf0000;
    background-color:#bf0000;
    width:350px;
    height:22px;
    padding:8px 0px 8px 8px;
}
</style>


<style type="text/css">

/* 個数入力欄の大きさ */
input#units {
padding: 2px 0px;
}

/* お買い物かごボタンの大きさ */
td > input {
font-size: 20px;
padding:20px 50px;
width: auto;
}

/* 「商品についての問い合わせ」ボタンの大きさ*/
font input {
font-size: 12px;
padding:2px;
width: 300px;
}


</style>


<style type="text/css">


div#HeaderKeyword {
 position:absolute;
 top:75px;/*一番上からの位置*/
 left:30px;/*左端からの位置*/
}

div#HeaderKeyword span {
 background: #bf0000;
 color:#fff;
 font-weight:bold;
 padding:2px 5px;
}

div#HeaderKeyword a {
