}


</style>

<style TYPE="text/css"> 

span.unit {
display:block;
background:url(http://image.rakuten.co.jp/w-import/cabinet/etc/kago-shukka.jpg)
no-repeat left top;
width:300px;
height:100px;
text-indent:-9999;
} 

body{ 
color: #454545;
font-size:12px;
font-family:Verdana, MS UI Gothic, Helvetica, sans-serif;
background-color: #ffffff;
margin:0;
text-align:center;


/*スクロールバー*/
scrollbar-base-color:#F7F7F7;
scrollbar-track-color:#F7F7F7;
