恋に落ちた「MOMENT：瞬間」に頬をピンク色に染めて光り輝く女性を表現した、甘美で清らかで洗練された香り。フレッシュでフルーティーな香りでたち上がったあと、ピンク・ピオニーをはじめとした花々の誘うような甘美な香りに移ろい、ウッディとムスクがさらに女性らしく高揚感を感じさせる香りへと変化していきます。<br>トップノート　：　ライチ、グアバ、ザクロ<br>ミドルノート　：　ピンクピオニー、パッションフラワー、スイレン<br>ラストノート　：　ムスク、ローズウッド、カシミール <br>広告文責：株式会社ＮＳコーポレーション 06-6224-3878<!--GoQSystemレジよこメーカー--><!--GoQSystemレジよこメーカー--><style type="text/css">

